/* Model creation/destruction functions */

void MODEL_mkTB::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkTB_instance = new MOD_mkTB(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkTB_instance->INST_m.INST_hg_fifo__input__TO_Start.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_fifo_Start_TO_Stage__1.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_fifo_Stage__1_TO_Stage__2.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_fifo_Stage__2_TO_Stage__3.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_feature_lock_lockVec_0_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_feature_lock_lockVec_1_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_feature_lock_lockVec_2_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_feature_lock_lockVec_3_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_weight_lock_lockVec_0_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_weight_lock_lockVec_1_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_weight_lock_lockVec_2_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_weight_lock_lockVec_3_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_h_lock_lockVec_0_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_h_lock_lockVec_1_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_h_lock_lockVec_2_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_h_lock_lockVec_3_held.set_clk_0)("CLK");
  (mkTB_instance->INST_m.INST_hg_outputQueue.set_clk_0)("CLK");
  (mkTB_instance->INST_m.set_clk_0)("CLK");
  (mkTB_instance->set_clk_0)("CLK");
}
void MODEL_mkTB::destroy_model()
{
  delete mkTB_instance;
  mkTB_instance = NULL;
}
void MODEL_mkTB::reset_model(bool asserted)
{
  (mkTB_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkTB::get_instance()
{
  return mkTB_instance;
}

/* Fill in version numbers */
void MODEL_mkTB::get_version(unsigned int *year,
			     unsigned int *month,
			     char const **annotation,
			     char const **build)
{
  *year = 0u;
  *month = 0u;
  *annotation = NULL;
  *build = NULL;
}

/* Get the model creation time */
time_t MODEL_mkTB::get_creation_time()
{
  
  /* Thu Jan  1 00:00:00 UTC 1970 */
  return 0llu;
}

/* State dumping function */
void MODEL_mkTB::dump_state()
{
  (mkTB_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkTB & mkTB_backing(tSimStateHdl simHdl)
{
  static MOD_mkTB *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkTB(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkTB::dump_VCD_defs()
{
  (mkTB_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkTB::dump_VCD(tVCDDumpType dt)
{
  (mkTB_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkTB_backing(sim_hdl));
}
